Rick Sammons HDR Photography Secrets for Digital Photographers.

Top photographer Rick Sammon shares his greatest HDR tips and tricks.
High Dynamic Range (HDR) photography is a process in which a photographer shoots multiple shots of the same subject at varying exposure settings and then &quot;stitches&quot; the images together with photo-editing software into a single photo that presents sharper color and focus than a single image. World-renowned digital photographer and Canon Explorer of Light Rick Sammon reveals his most amazing HDR tips, tricks, and techniques for creating the best possible HDR images.
Packed with more than 150 of Sammon's stunning full-color photos and more than 200 techniques, this invaluable guide inspires and motivates you to capture and edit your own unique still-life images.

